import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const message = "hello sir"
  fetch('/getwich')
    .then(response => console.log(response))

  return (
    <div className="App">
        <p>{message}</p>
    </div>
  );
}

export default App;
